import React from 'react';

const DiseaseDetection = () => {
    return (
        <div style={{ textAlign: 'center', padding: '20px' }}>
            <h1>Disease Detection</h1>
            <p>Here you can input data for disease detection.</p>
        </div>
    );
};

export default DiseaseDetection;
